import Pusher from 'pusher-js';

const pusher = new Pusher('f790521ed52ae6aaf77e', {
    cluster: 'eu',
    forceTLS: true,
    authEndpoint: 'https://localHost:8000/pusher/auth'
  });

  export default pusher;
